import React from "react";
import image from "../img/item-1.png";

const Item = ({ item }) => {
  const trimExtension = (filename) => filename.split(".")[0];
  return (
    <>
      <li className="item">
        <a href={`/collection/${trimExtension(item.image)}`}>
          <img src={item.image} alt={item.name} />
        </a>
      </li>
    </>
  );
};

export default Item;
